          "message": "feat: Partial epoch proofs (#14342)\n\nSupport partial epoch proofs by manually triggering a `startProof` on\nthe prover node RPC API. This required disabling the epoch check in\nthose jobs, otherwise the job would kill itself when a new block was\nadded to the epoch.\n\nAlternatively, we could keep the check and add a numeric block range to\nthe epoch job, as @alexghr suggested.",
