          "id": "39f89053d2fb7057bcc3c297505914e34811fd40",
          "message": "chore: add static asserts for LIBRA_UNIVARIATES_LENGTH (#14400)\n\nCurrent implementation of ZK Sumcheck and SmallSubgroupIPA assumes that \n`BATCHED_RELATION_PARTIAL_LENGTH` of all ZK Flavors running over BN254\nis == `LIBRA_UNIVARIATES_LENGTH` of BN254.\n\nTo get rid of this assumption, we can template SmallSubgroupIPAVerifier\nclass on `virtual_log_n` (= num sumcheck rounds) and `max_poly_length`\n(= `BATCHED_RELATION_PARTIAL_LENGTH` determined by a given Flavor)",
